const sumar = (a, b) => {
    return a + b;
};
const restares = (a, b) => {
    return a - b;
};
const multiplicar = (a, b) => {
    return a * b;
};
const dividir = (a, b) => {
    return a / b;
};
sumar(1, 2); // 3 
restares(1, 2); // -1 
multiplicar(1, 2); // 2  
dividir(1, 2); // 0.5    
